    render()
    {

        return(
              <FlatList
                data={this.props.CountryList}
                renderItem={({item})=>(
                    <Country data={item} navigateProduct={this.navigateHandler } > </Country>
                )}/>           
        );
    }
}; 


export default ListComponent;
